import React from "react";

class Button extends React.Component {
  constructor(props) {
    super(props);
    this.state = {clicked:false};
  }
  render() {
    const {clicked} = this.state;
    if(clicked) {
      return "clicked";
    }
    const date = new Date().toLocaleTimeString();
    return (
      <div>
        <div>{date}</div>
        <button onClick={()=>this.setState({clicked : true})}>ClickMe</button>
      </div>
    )
  }

}

function App() {
  return (
    <>
    <h1>hello world</h1>
    <Button />
    </>
  );
}

export default App;
